import "./footer.css";

function Footer() {
  return (
    <>
      <div className="Apps">
        <div className="header-divs">
          <footer className="footer">
            <h3>
              Coded by
              <a className="link" href="https://twitter.com/aminat_adenuga">
                {" "}
                Corazon|DEV
              </a>
              .
            </h3>
          </footer>
        </div>
      </div>
    </>
  );
}
export default Footer;
